webpackJsonp([0xe964513adfc4],{565:function(A,a){A.exports={data:{file:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:.9657118055555556,src:"/static/avatar-820706df6fdb07a9b021a790449fec17-381d6.jpg",srcSet:"/static/avatar-820706df6fdb07a9b021a790449fec17-62f05.jpg 200w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-dc2b4.jpg 400w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-381d6.jpg 800w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-e5d70.jpg 1200w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-d14e0.jpg 1600w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-9cc71.jpg 2225w",srcWebp:"/static/avatar-820706df6fdb07a9b021a790449fec17-fefde.webp",srcSetWebp:"/static/avatar-820706df6fdb07a9b021a790449fec17-5eed2.webp 200w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-68e3c.webp 400w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-fefde.webp 800w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-300fe.webp 1200w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-ed5bd.webp 1600w,\n/static/avatar-820706df6fdb07a9b021a790449fec17-9442a.webp 2225w",sizes:"(max-width: 800px) 100vw, 800px"}}},site:{siteMetadata:{title:"Kostas Bariotis' Blog",description:'Senior full stack engineer <a href="https://geekbot.io">@geekbot_io</a>, co-organizer of <a href="https://devitconf.org">@devitconf</a> & <a href="https://www.meetup.com/Thessaloniki-Node-js-Meetup/">@skgnodejs</a>, host of <a href="http://devastation.tv">Devastation Podcast</a>.',siteUrl:"https://kostasbariotis.com"}},mainPost:{html:'<p><a href="http://meetin5.blogspot.gr/2012/04/startup-bugsense.html" title="Bugsense και η... αμείλικτη αφοσίωση!">Bugsense και η... αμείλικτη αφοσίωση!</a></p><p>Η ελληνική start up σκηνή προσθέτει άλλο ενα <a href="http://www.emea.gr/%CE%B7-%CE%B5%CE%BB%CE%BB%CE%B7%CE%BD%CE%B9%CE%BA%CE%AE-startup-bugsense-%CE%B5%CE%BE%CE%B1%CE%B3%CE%BF%CF%81%CE%AC%CE%B6%CE%B5%CF%84%CE%B1%CE%B9-%CE%B1%CF%80%CF%8C-%CF%84%CE%B7%CE%BD-splunk/357166">βραβείο </a>στο ενεργητικό της. Οι ιδρυτές της <a title="BugSence" href="https://www.google.gr/url?sa=t&amp;rct=j&amp;q=&amp;esrc=s&amp;source=web&amp;cd=1&amp;cad=rja&amp;ved=0CDMQFjAA&amp;url=http%3A%2F%2Fwww.bugsense.com%2F&amp;ei=_go4UqqdHMbAhAfrvICQCw&amp;usg=AFQjCNGMSTtmTn4i3GJEUotB6axhIDVYGA&amp;sig2=Iw85DDQ1Rlh-nEGBUrqfvw&amp;bvm=bv.52164340,d.ZG4">BugSense</a>, εξηγούν σε απλά ελληνικά την πορεία τους μέχρι τώρα, την συνεργασία τους με τον αμερικανικό όμιλο <a href="https://www.google.gr/url?sa=t&amp;rct=j&amp;q=&amp;esrc=s&amp;source=web&amp;cd=1&amp;cad=rja&amp;ved=0CEMQFjAA&amp;url=http%3A%2F%2Fwww.splunk.com%2F&amp;ei=TQs4UrXtMc20hAfR04DwCQ&amp;usg=AFQjCNH0mmqx1CLXBHPhtOcJYpTuByD2zw&amp;sig2=cJAi-DbzGEbq11PKrGo4Tw&amp;bvm=bv.52164340,d.ZG4">Splunk, </a>τους λόγους που τους εμποδίζουν να προχωρήσουν και να φτάσουν μέχρι και να κατακτήσουν την Αμερικάνικη αγορά αλλά και τους λογούς που η ελληνική νομοθεσία τους κρατάει κάτω. Αστείρευτες πηγές έμπνευσης...</p><p>Προσωπικά, αυτό που κράτησα είναι η φράση, του γνωστού "πειρατή" Steve Jobs:</p><blockquote><p>Προσωπικά, προτιμώ να είμαι πειρατής, παρά να καταταγώ στο ναυτικό, όπως είπε κάποτε ο Steve Jobs.</p></blockquote><p>Think different, λοιπόν και ένα μεγάλο `Εύγε!` στα παιδιά!</p>',excerpt:"",frontmatter:{date:"September 17, 2013",path:"/bugsense-wins/",tags:null,title:"Bugsense και η... αμείλικτη αφοσίωση!",draft:null}},nextPost:{html:'<p><a href="http://googlepolicyeurope.blogspot.gr/2013/09/whats-state-of-european-union-askbarroso.html" title="Here\'s your chance to ask President Barosso ">Here\'s your chance to ask President Barosso </a></p><p>Google+ will host a hangout, main guest will be President of the European Comission <b><a title="José Manuel Barroso" href="http://en.wikipedia.org/wiki/Jos%C3%A9_Manuel_Barroso">José Manuel Barroso</a>. Here\'s your chance...</b></p><blockquote><p><i>Is Europe really emerging from the financial crisis? What’s going to happen to Europe’s 5 million unemployed young people? Does the rise of euro-sceptic politics spell the end of the EU as we know it? Will Europe act on Syria? </i></p></blockquote>',excerpt:"",frontmatter:{date:"September 09, 2013",path:"/heres-your-chance-to-ask-president-barosso/",tags:null,title:"Here's your chance to ask President Barosso",draft:null}}},pathContext:{mainPostPath:"/bugsense-wins/",nextPostPath:"/heres-your-chance-to-ask-president-barosso/"}}}});
